INSERT INTO `shop_news` (`id`, `title`, `alias`, `info`, `content`, `image`, `status`, `create_date`, `update_date`, `type_news`, `page`) VALUES
(1, 'Cam kết lợi ích khi mua online', 'Cam-ket-loi-ich-khi-mua-online', 'Mua - bán hàng qua mạng - hình thức thương mại mới xuất hiện ở Việt Nam nhưng nhanh chóng phát triển, lôi kéo được nhiều khách hàng tin dùng. Mua hàng qua mạng có nhiều điểm ưu việt so với cách mua- bán trực tiếp ', '<h2>Niềm tin &amp; Dịch vụ chăm s&oacute;c kh&aacute;ch h&agrave;ng tuyệt vời</h2>\r\n<p>Ch&uacute;ng t&ocirc;i tin rằng:</p>\r\n<ul class="list">\r\n<li>Mọi người lu&ocirc;n muốn hợp t&aacute;c với người m&agrave; họ tin tưởng.</li>\r\n<li>Mọi người lu&ocirc;n muốn hợp t&aacute;c với người c&oacute; hiểu biết, l&agrave;m việc hiệu quả v&agrave; lu&ocirc;n thực hiện những g&igrave; đ&atilde; hứa.</li>\r\n</ul>\r\n<p>Tại&nbsp;Cửa h&agrave;ng <strong>Vỏ m&acirc;m xe n&acirc;ng Ngọc Thanh</strong>, kh&aacute;ch h&agrave;ng v&agrave; niềm tin của kh&aacute;ch h&agrave;ng l&agrave; điều ch&uacute;ng t&ocirc;i lu&ocirc;n t&acirc;m niệm. shop cam kết b&aacute;n h&agrave;ng 100% ch&iacute;nh h&atilde;ng,đ&uacute;ng như th&ocirc;ng tin sản phẩm, v&agrave; sẽ&nbsp;ho&agrave;n trả gấp đ&ocirc;i&nbsp;cho bạn nếu sản phẩm kh&ocirc;ng phải ch&iacute;nh h&atilde;ng. Để mang lại sự h&agrave;i l&ograve;ng v&agrave; thoải m&aacute;i cho kh&aacute;ch h&agrave;ng, ch&uacute;ng t&ocirc;i c&oacute;&nbsp;ch&iacute;nh s&aacute;ch đổi trả h&agrave;ng trong 2 ng&agrave;y: kh&aacute;ch h&agrave;ng c&oacute; thể đổi trả bất kỳ sản phẩm n&agrave;o đ&atilde; mua ở shop trong v&ograve;ng 2 ng&agrave;y. Nếu bạn cần trợ gi&uacute;p để nhận dạng h&agrave;ng thật giả, xin li&ecirc;n hệ với ch&uacute;ng t&ocirc;i .</p>\r\n<h2>Thuận tiện</h2>\r\n<p><em>&ldquo;T&ocirc;i th&iacute;ch việc c&oacute; thể ngồi tại nh&agrave;, mặc bộ đồ ngủ của m&igrave;nh, bất chấp b&ecirc;n ngo&agrave;i trời đang nắng n&oacute;ng hay mưa gi&oacute;, t&ocirc;i c&oacute; thể mua sắm bất kỳ l&uacute;c n&agrave;o t&ocirc;i muốn. T&ocirc;i thấy thư gi&atilde;n khi mua sắm, nhưng t&ocirc;i gh&eacute;t sự hối hả của đ&aacute;m đ&ocirc;ng v&agrave; sự ồn &agrave;o&rdquo;</em>&nbsp;&ndash; Chị&nbsp;Nguyễn Thu Thủy&nbsp;&ndash; Doanh nh&acirc;n, chia sẻ.</p>\r\n<p>Sự thuật tiện l&agrave; 1 lợi &iacute;ch tuy&ecirc;t vời khi mua sắm trực tuyến tạiCửa h&agrave;ng Vỏ m&acirc;m xe n&acirc;ng Ngọc Thanh. Mua sắm trực tuyến rất đơn giản: bạn chỉ cần ngồi trước m&aacute;y t&iacute;nh, v&agrave;i c&uacute; click chuột, lựa chọn sản phẩm bạn th&iacute;ch trong rất nhiều sản phẩm. Sau đ&oacute; sản phẩm sẽ được giao trực tiếp đến tận nh&agrave; bạn.</p>\r\n<p>Nếu bạn cần mua qu&agrave; cho một người bạn tại tỉnh th&agrave;nh kh&aacute;c, bạn kh&ocirc;ng cần lo lắng, ch&uacute;ng t&ocirc;i sẽ g&oacute;i qu&agrave; v&agrave; vận chuyển sản phẩm đến người bạn của bạn nhanh ch&oacute;ng .</p>\r\n<h2>Sự lựa chọn đa dạng</h2>\r\n<p>Tại&nbsp;Cửa h&agrave;ng <strong>Vỏ m&acirc;m xe n&acirc;ng Ngọc Thanh</strong>, ch&uacute;ng t&ocirc;i tập trung v&agrave;o những sản phẩm độc nhất:</p>\r\n<ul class="list">\r\n<li><strong>ĐỘC NHẤT</strong>: 80% những sản phẩm tại&nbsp;Cửa h&agrave;ng <strong>Vỏ m&acirc;m xe n&acirc;ng Ngọc Thanh</strong> bạn kh&ocirc;ng thể t&igrave;m thấy nơi n&agrave;o kh&aacute;c ở Việt Nam.</li>\r\n<li><strong>GI&Aacute; HỢP L&Yacute;</strong>: . Nếu bạn t&igrave;m thấy trung t&acirc;m thương mại n&agrave;o b&aacute;n gi&aacute; thấp hơn&nbsp;Cửa h&agrave;ng <strong>Vỏ m&acirc;m xe n&acirc;ng Ngọc Thanh</strong>, ch&uacute;ng t&ocirc;i sẽ chấp nhận b&aacute;n cho bạn thấp hơn 5% so với gi&aacute; ở shop kh&aacute;c.</li>\r\n</ul>\r\n<p>Hơn nữa,&nbsp;Cửa h&agrave;ng <strong>Vỏ m&acirc;m xe n&acirc;ng Ngọc Thanh</strong> c&ograve;n c&oacute; thể nhận đặt h&agrave;ng v&agrave; chuyển h&agrave;ng đến tỉnh th&agrave;nh kh&aacute;c.</p>', '2013_10_11_17_54_59-vomamxenang-Loi-ich-khi-mua-online-1.jpg,2013_10_11_17_54_59-vomamxenang-Loi-ich-khi-mua-online-2.jpg', '1', 1371979450, 1381489245, '1', ''),
(2, 'Giao nhận hàng hoá xuất nhập khẩu', 'Giao-nhan-hang-hoa-xuat-nhap-khau', 'DACO Logistics được phép của hải quan thay mặt chủ hàng đứng tên trên tờ khai, thực hiện thủ tục khai báo hải quan, nộp thuế, giao nhận và vận chuyển hàng hóa xuất nhập khẩu giúp khách hàng đơn giản hóa trong các thủ tục chứng từ phức tạp khi khai báo hải quan và giao nhận hàng hóa xuất nhập khẩu.', '<p><strong>Dịch vụ của ch&uacute;ng t&ocirc;i bao gồm:</strong></p>\r\n<p>&bull;&nbsp;&nbsp;&nbsp; <a title="Lập tờ khai hải quan" href="/tintuc-Giao-nhan-hang-hoa-xuat-nhap-khau">Lập tờ khai</a> v&agrave; ho&agrave;n th&agrave;nh thủ tục khai b&aacute;o hải quan.<br />&bull;&nbsp;&nbsp;&nbsp; Ho&agrave;n th&agrave;nh c&aacute;c thủ tục tại cảng v&agrave; giao h&agrave;ng/nhận h&agrave;ng.<br />&bull;&nbsp;&nbsp;&nbsp; Giải quyết c&aacute;c vấn đề ph&aacute;t sinh. (Nếu c&oacute;)<br />&bull;&nbsp;&nbsp;&nbsp; Đ&oacute;ng h&agrave;ng/r&uacute;t h&agrave;ng tại cảng.<br />&bull;&nbsp;&nbsp;&nbsp; Giao nhận h&agrave;ng h&oacute;a xuất nhập khẩu từ cảng hoặc s&acirc;n bay đến kh&aacute;ch h&agrave;ng v&agrave; ngược lại.<br />&bull;&nbsp;&nbsp;&nbsp; Giao nhận h&agrave;ng h&oacute;a qua trung t&acirc;m ph&acirc;n phối.</p>\r\n<p><span>&ldquo;Kinh nghiệm nhiều năm trong c&ocirc;ng t&aacute;c khai b&aacute;o hải quan gi&uacute;p ch&uacute;ng t&ocirc;i giải quyết nhiều vấn đề ph&aacute;t sinh trong khai b&aacute;o bằng c&aacute;ch thay mặt chủ h&agrave;ng k&yacute; t&ecirc;n v&agrave; đ&oacute;ng dấu tr&ecirc;n tờ khai hải quan, thể hiện được tr&aacute;ch nhiệm của người khai b&aacute;o hải quan&rdquo;.</span><br /><strong>Ms. Đo&agrave;n Thị Thu Sương, Customs Broker Department.</strong></p>\r\n<p><span><strong>Để được tư vấn về dịch vụ, vui l&ograve;ng li&ecirc;n hệ:</strong></span></p>\r\n<p><strong>Ms. <strong>Đo&agrave;n Thị Thu Sương</strong><br /></strong></p>\r\n<p>Phone: 0908.111.844</p>\r\n<p>Email:&nbsp;<a href="mailto:doanthithusuong05@gmail.com">doanthithusuong05@gmail.com</a></p>\r\n<p>Yahoo: <a href="mailto:dtts14@yahoo.com">dtts14@yahoo.com</a></p>\r\n<p>Skype: dtts14</p>', '', '1', 1381312731, 1386143731, '1', '1');
